@pytest.mark.slow
class TestEosGreymassApiCalls(TestCase):
    api = EosGreymassApi
    hash_of_transactions = ['139a3feebed6eb9a93be9d5e64eca5ce6265022715584384f20d6d2635c43591',
                            '1b613521679c3c51de24b50a1b5c1b707ff1991d922781dfdfa26d53bd6c26b9',
                            '2062e1b8ca7832cd3f442c56228d430885b9ff6a413906b30638ee90bed90b25',
                            ]
    addresses_of_accounts = ['geytmmrvgene', 'eostexpriwh1']

    def check_general_response(self, response, keys):
        if set(keys).issubset(set(response.keys())):
            return True
        return False

    def keys_types_check(self, response, keys_types_check):
        for key, value in keys_types_check:
            self.assertIsInstance(response.get(key), value)

    def test_get_tx_details_api(self):
        response_keys = {'block_num', 'block_time', 'head_block_num', 'id', 'irreversible', 'last_irreversible_block',
                         'traces', 'transaction_num', 'trx'}
        response_types_check = [('block_num', int), ('block_time', str), ('head_block_num', int), ('id', str),
                                ('irreversible', bool), ('trx', dict)]
        actions_keys = {'account', 'authorization', 'data', 'hex_data', 'name'}
        action_types_check = [('account', str), ('authorization', list), ('data', dict), ('name', str), ]
        authorization_keys = {'actor', 'permission'}
        authorization_types_check = [('actor', str), ('permission', str)]
        data_keys = {'from', 'memo', 'quantity', 'to'}
        data_types_check = [('from', str), ('memo', str), ('quantity', str), ('to', str)]
        for tx_hash in self.hash_of_transactions:
            get_tx_details_response = self.api.get_tx_details(tx_hash)
            assert self.check_general_response(get_tx_details_response, response_keys)
            for key, value in response_types_check:
                assert isinstance(get_tx_details_response.get(key), value)
            if get_tx_details_response.get('trx'):
                assert get_tx_details_response.get('trx').get('trx')
                assert isinstance(get_tx_details_response.get('trx').get('trx'), dict)
                assert (get_tx_details_response.get('trx').get('trx').get('actions') and isinstance(
                    get_tx_details_response.get('trx').get('trx').get('actions'), list))
                actions = get_tx_details_response.get('trx').get('trx').get('actions')
                for action in actions:
                    assert self.check_general_response(action, actions_keys)
                    for key, value in action_types_check:
                        assert isinstance(action.get(key), value)
                    authorization = action.get('authorization')[0]
                    assert self.check_general_response(authorization, authorization_keys)
                    for key, value in authorization_types_check:
                        assert isinstance(authorization.get(key), value)
                    if self.check_general_response(action.get('data'), data_keys):
                        for key, value in data_types_check:
                            assert isinstance(action.get('data').get(key), value)

    def test_get_address_txs_api(self):
        address_txs_response_keys = {'actions', 'last_irreversible_block'}
        address_txs_response_keys_types_check = [('actions', list), ('last_irreversible_block', int)]
        action_keys = {'action_trace', 'block_num', 'block_time', 'irreversible'}
        action_keys_types_check = [('action_trace', dict), ('block_num', int),
                                   ('block_time', str), ('irreversible', bool)]
        action_trace_keys = {'producer_block_id', 'receiver', 'trx_id', 'act'}
        action_trace_keys_types_check = [('act', dict), ('receiver', str), ('trx_id', str), ('producer_block_id', str)]
        act_keys = {'account', 'authorization', 'data', 'name'}
        act_keys_types_check = [('account', str), ('authorization', list), ('data', dict), ('name', str)]
        authorization_keys = {'actor', 'permission'}
        authorization_keys_types_check = [('actor', str), ('permission', str)]
        data_keys = {'from', 'memo', 'quantity', 'to'}
        data_keys_types_check = [('from', str), ('memo', str), ('quantity', str), ('to', str)]
        for address in self.addresses_of_accounts:
            get_address_txs_response = self.api.get_address_txs(address)
            self.assertIsInstance(get_address_txs_response, dict)
            assert self.check_general_response(get_address_txs_response, address_txs_response_keys)
            self.keys_types_check(get_address_txs_response, address_txs_response_keys_types_check)
            actions = get_address_txs_response.get('actions')
            for action in actions:
                self.assertIsInstance(action, dict)
                assert self.check_general_response(action, action_keys)
                self.keys_types_check(action, action_keys_types_check)
                action_trace = action.get('action_trace')
                assert self.check_general_response(action_trace, action_trace_keys)
                self.keys_types_check(action_trace, action_trace_keys_types_check)
                act = action_trace.get('act')
                assert self.check_general_response(act, act_keys)
                self.keys_types_check(act, act_keys_types_check)
                authorization = act.get('authorization')[0]
                assert self.check_general_response(authorization, authorization_keys)
                self.keys_types_check(authorization, authorization_keys_types_check)
                if self.check_general_response(act.get('data'), data_keys):
                    self.keys_types_check(act.get('data'), data_keys_types_check)


